function goTo(str,boolean){if(boolean){return window.open(str,"_blank",'noopener')}
window.location.href=str}
$('button.back_top').on('click',function(e){e.preventDefault();$('html,body').animate({scrollTop:0},700)});$(document).scroll(function(){let isMobile=window.matchMedia("only screen and (max-width: 760px)").matches;if(!isMobile){var navbar=$('menu[type="higher"]');if($(document).scrollTop()>=300){navbar.addClass('fixed')}else{navbar.removeClass('fixed');navbar.fadeIn()}}});$(document).ready(function(){$("[data-show]").on('click',function(){let dataShow=$(this).attr("data-show");let dataRef=$(document).find("[data-show-ref='"+dataShow+"']");if(typeof dataRef!==typeof undefined){$(this).find(dataRef).slideToggle('medium')}})})